        <h2 class="secondary">DINOTEFURAN</h2>
        <p>Classified as a neonicotinoid, Dinotefuran provides effective control of nuisance flies and can be used in a variety of application sites. This active ingredient offers an ideal rotation partner with pyrethrin-based sprays to help prevent resistance issues.</p>
